,p_layer_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'WITH center AS (',
'    SELECT id',
'    , l.latitude, l.longitude',
'        , to_number( :P2_RADIUS_FROM_LOC DEFAULT NULL ON CONVERSION ERROR ) / 100 ',
'            + l.latitude AS north_most ',
'        , l.latitude  - to_number( :P2_RADIUS_FROM_LOC DEFAULT NULL ON CONVERSION ERROR ) / 100 ',
'                AS south_most ',
'        , l.longitude - to_number( :P2_RADIUS_FROM_LOC DEFAULT NULL ON CONVERSION ERROR ) / 100 ',
'                AS west_most ',
'        , to_number( :P2_RADIUS_FROM_LOC DEFAULT NULL ON CONVERSION ERROR ) / 100 ',
'            + l.longitude AS east_most ',
'    FROM vp_alph_major_locations l ',
'    WHERE l.id = :P2_MAJOR_LOCATION ',
' ), main AS ',
' (',
' SELECT name_display, longitude, latitude, altitude',
'    , name_normed||'' ''||altitude||''m'' AS tool_tip',
'FROM alph_mountain m',
'WHERE 1=1',
'  AND ( :P2_MAX_MOUNTAINS IS NULL OR rownum <= to_number( :P2_MAX_MOUNTAINS) ) ',
'  AND ( :P2_MIN_ALTI IS NULL OR altitude >= to_number( :P2_MIN_ALTI ) )',
'  AND ( :P2_MAX_ALTI IS NULL OR altitude <= to_number( :P2_MAX_ALTI ) )  ',
'  AND ( :P2_MAJOR_LOCATION IS NULL OR ',
'            latitude <= to_number( :P2_MAX_ALTI ) ',
'      )  ',
'  AND ( :P2_MAJOR_LOCATION IS NULL OR ',
'           ( 1=1 ',
'                AND latitude <= (SELECT north_most FROM center )',
'                AND latitude >= (SELECT south_most FROM center )',
'                AND longitude >= (SELECT west_most FROM center )',
'                AND longitude <= (SELECT east_most FROM center )',
'           )',
'      )  ',
' )     ',
'SELECT * FROM main ',
''))
,p_has_spatial_index=>false
,p_geometry_column_data_type=>'LONLAT_COLUMNS'
,p_longitude_column=>'LONGITUDE'
,p_latitude_column=>'LATITUDE'
,p_point_display_type=>'SVG'
,p_point_svg_shape=>'Default'
,p_feature_clustering=>false
,p_tooltip_adv_formatting=>false
,p_info_window_adv_formatting=>false
,p_info_window_title_column=>'NAME_DISPLAY'
,p_info_window_body_column=>'TOOL_TIP'
,p_allow_hide=>true
);
