wwv_flow_imp_page.create_jet_chart_series(
 p_id=>wwv_flow_imp.id(9555947215871747)
,p_chart_id=>wwv_flow_imp.id(9555865121871746)
,p_seq=>10
,p_name=>'distance - elevation'
,p_data_source_type=>'SQL'
,p_data_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'with test_gpx AS (',
'    select extract_child_gpx_from_xml( gpx_data ) content ',
'    from alph_tracks',
'    where id = 45',
'), add_seq AS (',
'		SELECT X.*',
'        , rownum as seq',
'--		FROM alph_tracks tr ',
'        FROM test_gpx g',
'        CROSS JOIN ',
'            xmlTable (',
'		--    ''/gpx/trk/trkseg/trkpt''',
'		    ''//trk/trkseg/trkpt''',
'		    PASSING xmltype (',
'                g.content )',
'		    COLUMNS ',
'		         lon VARCHAR2(10) PATH ''@lon''',
'		        ,lat VARCHAR2(10) PATH ''@lat''',
'		        ,ele VARCHar2(10) PATH ''ele''',
'		        ,id  NUMBER(20) PATH ''id''',
'		) x',
'), add_next_loc AS (',
'    SELECT aseq.*',
'    , lag ( lon ) over (partition by null order by seq ) next_lon ',
'    , lag ( lat ) over (partition by null order by seq ) next_lat ',
'    FROM add_seq aseq',
'), chart_data AS ( ',
'    SELECT  ele',
'        , CASE ',
'            WHEN seq = 2 THEN 0 ',
'            ELSE SDO_GEOM.SDO_DISTANCE(',
'                SDO_GEOMETRY(2001, 8307, SDO_POINT_TYPE(anl.lon, anl.lat, NULL), NULL, NULL)',
'               , SDO_GEOMETRY(2001, 8307, SDO_POINT_TYPE(anl.next_lon, anl.next_lat, NULL), NULL, NULL)',
'               , 0.005',
'           ) END',
'           AS  dist_in_meters',
'           , seq ',
'    FROM add_next_loc anl',
'    WHERE next_lat IS NOT NULL ',
'    ORDER BY seq ',
') ',
'SELECT to_number(ele) ele',
', sum( dist_in_meters ) OVER ( order by seq ) acc_didist_in_mst ',
', dist_in_meters||''m'' AS label ',
'FROM chart_data',
''))
,p_items_x_column_name=>'ACC_DIDIST_IN_MST'
,p_items_y_column_name=>'ELE'
,p_items_label_column_name=>'LABEL'
,p_line_style=>'solid'
,p_line_type=>'auto'
,p_marker_rendered=>'auto'
,p_marker_shape=>'auto'
,p_items_label_rendered=>false
);
